import React from 'react';
import Header from './Header';
import AboutMe from './AboutMe';
import Portfolio from './components/Portfolio';
import Contact from './Contact'; // You'll need to create the Contact component
import Resume from './Resume'; // You'll need to create the Resume component
import Footer from './Footer';

function App() {
  return (
    <div>
      <Header />
      <AboutMe />
      <Portfolio />
      <Contact />
      <Resume />
      <Footer />
    </div>
  );
}

export default App;

// Import the CSS file at the top of your JavaScript file
import './App.css';
